/* eslint-disable react/prop-types */
import React, { useState } from 'react';
import { Spin, Table, Empty } from 'antd';
import FeatherIcon from 'feather-icons-react';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { UserTableStyleWrapper } from '../pages/style';
import { TableWrapper } from '../styled';
import Heading from '../../components/heading/heading';
import { Button } from '../../components/buttons/buttons';
import { Cards } from '../../components/cards/frame/cards-frame';

import { deleteAdvertisement, getListAdvertisement } from '../../redux/advertisement/actionCreator';
import { SpinerWraperStyle } from '../ui-elements/ui-elements-styled';

const SubAdminTable = ({ data }) => {
    const dispatch = useDispatch();

    const { loading, notFound } = useSelector(state => state.Advertisement);

    const usersTableData = [];

    data.map(ad => {
        const { _id, image, title, status } = ad;

        return usersTableData.push({
            key: _id,
            name: (
                <div className="user-info">
                    <figure>
                        <img style={{ width: '40px' }} src={image} alt="" />
                    </figure>
                    <figcaption>
                        <Heading className="user-name" as="h6">
                            {title.length > 12 ? `${title.slice(0, 12)}...` : title}
                        </Heading>
                    </figcaption>
                </div>
            ),
            email: <div>acsaccsc@aaa.com</div>,
            phoneNO: <div>0122231111111</div>,
            role: <div>admin admin</div>,
            status,
            action: (
                <div className="table-actions">
                    <>
                        <Button className="btn-icon" type="view" shape="circle">
                            <FeatherIcon icon="eye" size={16} />
                        </Button>

                        <Link
                            className="btn-icon"
                            type="info"
                            to={status === 'ACTIVE' && `/admin/editAdvertisement/${_id}`}
                            shape="circle"
                        >
                            <FeatherIcon icon="edit" size={16} style={{ color: '#ADB4D2' }} />
                        </Link>
                        <Button
                            className="btn-icon"
                            type="danger"
                            to="#"
                            shape="circle"
                            onClick={() => {
                                dispatch(deleteAdvertisement(_id));
                            }}
                        >
                            <FeatherIcon icon="trash-2" size={16} />
                        </Button>
                    </>
                </div>
            ),
        });
    });

    const adsTableColumns = [
        {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
        },
        {
            title: 'E-mail',
            dataIndex: 'email',
            key: 'email',
        },
        {
            title: 'Status',
            dataIndex: 'status',
            key: 'status',
        },
        {
            title: 'Phone Number',
            dataIndex: 'phoneNO',
            key: 'phoneNO',
        },
        {
            title: 'ole',
            dataIndex: 'phoneNO',
            key: 'phoneNO',
        },
        {
            title: 'Actions',
            dataIndex: 'action',
            key: 'action',
            width: '90px',
        },
    ];

    return (
        <Cards headless>
            <UserTableStyleWrapper>
                <TableWrapper className="table-responsive">
                    {loading ? (
                        <SpinerWraperStyle>
                            <Spin />
                        </SpinerWraperStyle>
                    ) : !notFound ? (
                        <Table
                            dataSource={usersTableData}
                            columns={adsTableColumns}
                            pagination={{
                                defaultPageSize: 5,
                                total: 20,
                                showTotal: (total, range) => `${range[0]} - ${range[1]} of ${20} items`,
                                onChange: (page, pageSize) => {
                                    dispatch(getListAdvertisement(page, pageSize));
                                },
                            }}
                        />
                    ) : (
                        <Cards title="Basic" caption="The simplest use of Empty">
                            <Empty />
                        </Cards>
                    )}
                </TableWrapper>
            </UserTableStyleWrapper>
        </Cards>
    );
};

export default SubAdminTable;
